import React from "react";
import Header from "../Header/Header";
import bg from "../../Assets/medicalBG.png";
import "./Home.css";
function Home() {
  return (
    <>
      <Header />
      <div className="home">
        <div className="home__container">
          <div className="home__image">
            <img src={bg} alt="bg"></img>
          </div>
        </div>
      </div>
    </>
  );
}
export default Home;
